  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:36.518923\",\n\t\"name\": \"public-use-plan-long-island-national-wildlife-refuge-complex-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The intent of the Public Use Plan for the
  Long Island National Wildlife Refuge Complex is to assist with fulfilling future
  management needs of the Complex. This will be done by 1) establishing public use
  issues, using wildlife and habitat management objectives as stated in the Station
  Message for the Complex, and using Region 5 general public use objectives as guidelines,
  2) making a detailed and exhaustive analysis of all potential public use programs
  and activities to provide management recommendations, 3) establishing public use
  objectives and strategies for the Complex, 4) incorporating long-range planning
  using the proposed environmental education/ visitor center as a focal point, 5)
  and producing a workable timetable to implement the recommendations during the next
  three to five years.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
